// Function to generate random powerups
void generate_powerups() {
    // Generate a random number to determine if a powerup should spawn
    int rand_num = rand() % 100;

    if (rand_num < 10) {
        int powerup_type = rand() % 3; // Three types of powerups
        int x_position = rand() % (SCREEN_WIDTH - POWERUP_WIDTH); // Random x position
        int y_position = 0; // Spawn at the top of the screen

        // Find an inactive powerup slot to store the new powerup
        for (int i = 0; i < MAX_POWERUPS; i++) {
            if (!powerups[i].active) {
                // Activate the powerup and set its position and type
                powerups[i].active = true;
                powerups[i].x = x_position;
                powerups[i].y = y_position;
                powerups[i].type = powerup_type;
                break; // Exit loop after finding an empty slot
            }
        }
    }
}

// Function to update powerup positions
void update_powerups() {
    for (int i = 0; i < MAX_POWERUPS; i++) {
        if (powerups[i].active) {
            // Update the position of active powerups
            powerups[i].y += POWERUP_SPEED;

            // Check if the powerup is out of bounds
            if (powerups[i].y + POWERUP_HEIGHT >= 240) {
                powerups[i].active = false; // Deactivate powerup if it goes off-screen
				//clear_screen();
            }
        }
    }
}

// Function to handle powerup collisions with the slab
void handle_powerup_collisions() {
    for (int i = 0; i < 1; i++) {
        if (powerups[i].active &&
            powerups[i].x + POWERUP_WIDTH >= slab_x &&
            powerups[i].x <= slab_x + slab_width &&
            powerups[i].y + POWERUP_HEIGHT >= slab_y &&
            powerups[i].y <= slab_y + slab_height) {
			// powerup_sound = true;
			// volatile int *AUDIO_ptr = (int *)AUDIO_BASE;
			// *AUDIO_ptr = 0x2;
            // Collision detected with the slab

            // Activate the powerup effect based on its type
            switch (powerups[i].type) {
                case EXTRA_LIFE:
                    player_lives++;
                    break;
				case DOULBEPOINTS:
					points *= 2;
					break;
				case ENLARGED_SLAB:
					elongate_slab();
                	powerups[i].active = false;
					break;
                // Add more cases for other powerup types
            }

            // Deactivate the powerup
            powerups[i].active = false;
        }
    }
}

bool elongated_slab = false;

void elongate_slab() {
    slab_width = ELONGATED_SLAB_WIDTH;
    elongated_slab = true;

    // Start the timer
    timer->control = 0; // Disable the timer first
    timer->periodlo = 500000000 & 0xFFFF; // Lower 16 bits for longer width
    timer->periodhi = (500000000 >> 16) & 0xFFFF;
    timer->control = 0x4; // Enable the timer with interrupt and continuous mode
}

void update_slab_width() {
    if ((elongated_slab && timer->status == 1) || lost_life) {
        // Timer has elapsed, revert the slab width
        slab_width = NORMAL_SLAB_WIDTH;
        elongated_slab = false;
		lost_life = false;
		timer->control = 0x0; // Disable timer
		printf("End");
    }
}

void draw_border() {
    int x, y;
    // Drawing the border
    // Top and bottom borders
    for (x = 0; x < 320; x++) {
        // Top border
        for (y = 0; y < 4; y++) {
            plot_pixel(x, y, 0); 
        }
        // Bottom border
        for (y = 0; y < 4; y++) {
            plot_pixel(x, 239 - y, 0xFFFF); 
        }
    }
    // Left and right borders
    for (y = 0; y < 240; y++) {
        // Left border
        for (x = 0; x < 4; x++) {
            plot_pixel(x, y, 0); 
        }
        // Right border
        for (x = 0; x < 4; x++) {
            plot_pixel(319 - x, y, 0); 
        }
    }
}


void draw_current_tiles() {
    for (int i = 0; i < 8; i++) {
        for (int j = 0; j < 7; j++) {
            struct Tile *tile = &tiles[i][j]; // Get a pointer to the current tile
            if (tile->active) {
                draw_box(tile->x, tile->y, tile->color); // Draw the active tile using its color
            }
        }
    }
}

// Initialize tile data
void initialize_tiles() {
    for (int i = 0; i < 8; i++) {
        for (int j = 0; j < 7; j++) {
            tiles[i][j].x = 39 * i + 4;
            tiles[i][j].y = 12 * j + 4;
            tiles[i][j].width = 39;
            tiles[i][j].height = 12;

            // Set strength and initial color based on row and column
            switch (j) {
                case 0:
                    tiles[i][j].strength = 7; // Purple: 7 hits
                    tiles[i][j].color = PURPLE;
                    break;
                case 1:
                    tiles[i][j].strength = 6; // Red: 6 hits
                    tiles[i][j].color = RED;
                    break;
                case 2:
                    tiles[i][j].strength = 5; // Orange: 5 hits
                    tiles[i][j].color = ORANGE;
                    break;
                case 3:
                    tiles[i][j].strength = 4; // Yellow: 4 hits
                    tiles[i][j].color = YELLOW;
                    break;
                case 4:
                    tiles[i][j].strength = 3; // Green: 3 hits
                    tiles[i][j].color = GREEN;
                    break;
                case 5:
                    tiles[i][j].strength = 2; // Blue: 2 hits
                    tiles[i][j].color = BLUE;
                    break;
                case 6:
                    tiles[i][j].strength = 1; // Gray: 1 hit
                    tiles[i][j].color = GRAY;
                    break;
            }

            // Set tile as active if strength is greater than 0
            tiles[i][j].active = (tiles[i][j].strength > 0);
        }
    }
}

void check_tile_collision() {
    if (ball_y - 5 > 88) {
        return;
    }
	// Check if the ball is outside the playable area
    if (ball_x - 5 < 0 || ball_x + 5 > SCREEN_WIDTH || ball_y - 5 < 0 || ball_y + 5 > SCREEN_HEIGHT) {
        // Reverse the ball's direction if it's about to go out of bounds
        if (ball_x - 5 < 0 || ball_x + 5 > SCREEN_WIDTH) {
            ball_dx = -ball_dx; // Reverse horizontal direction
        }
        if (ball_y - 5 < 0 || ball_y + 5 > SCREEN_HEIGHT) {
            ball_dy = -ball_dy; // Reverse vertical direction
        }
        return;
    }

    for (int i = 0; i < 8; i++) {
        for (int j = 0; j < 7; j++) {
            struct Tile *tile = &tiles[i][j]; // Get a pointer to the current tile
            if (tile->active &&
                ball_x - 5 <= tile->x + tile->width &&
                ball_x + 5 >= tile->x &&
                ball_y - 5 <= tile->y + tile->height &&
                ball_y + 5 >= tile->y) {
                // Collision detected with tile
				tile_sound = true;
				volatile int *AUDIO_ptr = (int *)AUDIO_BASE;
				*AUDIO_ptr = 0x2;
				// NIOS2_WRITE_IENABLE(0x40);
                ball_dy *= -1; // Reverse vertical direction
                if (ball_dx > 0 && ball_x + 5 >= tile->x && ball_x - 5 <= tile->x) {
                    // Ball is moving right and collides with the left side of the tile
                    ball_dx *= -1; // Reverse horizontal direction
                } else if (ball_dx < 0 && ball_x - 5 <= tile->x + tile->width && ball_x + 5 >= tile->x + tile->width) {
                    // Ball is moving left and collides with the right side of the tile
                    ball_dx *= -1; // Reverse horizontal direction
                }
                tile->strength--; // Decrement the strength of the tile
                if (tile->strength == 0) {
                    tile->active = false; // Deactivate the tile if strength reaches zero
                } else {
                    // Update tile color based on strength
                    switch (tile->strength) {
                        case 7:
                            tile->color = PURPLE;
                            break;
                        case 6:
                            tile->color = RED;
                            break;
                        case 5:
                            tile->color = ORANGE;
                            break;
                        case 4:
                            tile->color = YELLOW;
                            break;
                        case 3:
                            tile->color = GREEN;
                            break;
                        case 2:
                            tile->color = BLUE;
                            break;
                        case 1:
                            tile->color = GRAY;
                            break;
                    }
                }
                points += tile->strength;
                display_points();
                return; // Exit after handling collision with one tile
            }
        }
    }
}

void draw_box(int x, int y, short int box_color) {
  bool draw_black = false;
  for (int i = x; i < x+39; i++) {
	  if (i == x+38) draw_black = true; 
	  for (int j = y; j < y+12; j++) {
		  if (draw_black) plot_pixel(i, j, 0);
		  else plot_pixel(i, j, box_color);
	 }
  }
}

void draw_ball(int x, int y, int radius, short int color) {
    for (int dy = -radius; dy <= radius; dy++) {
        for (int dx = -radius; dx <= radius; dx++) {
            if (dx*dx + dy*dy <= radius*radius) {
                plot_pixel(x + dx, y + dy, color);
            }
        }
    }
}

void draw_slab(int x, int y, int width, int height, short int color) {
    // Draw the rectangle representing the slab
    for (int i = 0; i < width; i++) {
        for (int j = 0; j < height; j++) {
            plot_pixel(x + i, y + j, color);
        }
    }
}



void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xff203020;  // base address
  int status;
  *pixel_ctrl_ptr = 1;  // start the synchronization process
  // - write 1 into front buffer address register
  status = *(pixel_ctrl_ptr + 3);  // read the status register
  while ((status & 0x01) != 0)     // polling loop waiting for S bit to go to 0
  {
    status = *(pixel_ctrl_ptr + 3);
  }
}

